    "people-with-dementia-as-witnesses-to-emotional-events-in-southern-california-2008-2009-c7226",nt"isopen":
    false,nt"url": null,nt"notes": "The study sought evidence that a subset
    of people with dementia (PwD) has reliable memory for emotional events in their
    own lives, and they differ from PwD whose memory for emotional life events is less
    reliable or unreliable in respect to their own disease stage, confabulation and
    neuropsychiatric behaviors, and awareness of their cognitive impairment. In addition
    and in the context of a structured interview, they can provide (hypothetically)
    more details related to memories for emotional life events and discuss the events
    with the same accuracy after a time delay.",nt"license_title": "License Not
